import React from 'react';
import "./Body.css"

const Body = () => {
  return (
    < >
        <div className="col-2">
            <div className="descriptiuon">
                <p className='para'>UX/UI DESIGNER</p>
                <h1 className="heading">Hello My Name <br /> Is Madelyn Torff</h1>
             </div>
            <div className="imagePara">
                <h1>kesahv</h1>
                <p>short text with detail about you , want you <br /> do or your
                    professional career.you can add <br /> more information on the about page.
                </p>
              </div>
        </div>
    </>
  );
}

export default Body;
